import React from "react";

export default function GroupHeader(props) {
  return (
    <div className="header">
      <div className="parcel-header back-danger">Mumbai</div>
      <div className="parcel-header back-warning">Delhi</div>
      <div className="parcel-header back-secondary">Kolkata</div>
    </div>
  );
}
